import React from 'react';
import styles from '../../styles/components/admin_project.module.scss';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';

const AdminProject = (props) => {
	return (
		<div className={styles.project}>
			<img className={styles.project__bg} src={props.img} alt="project image" />
            <div className={styles.project__header}>
                <h5 className={styles.project__title}>{props.title}</h5>
            </div>
			<div className={styles.project__toolbar}>
				<FontAwesomeIcon className={styles.project__toolbar__link} icon="link" />
				<div className={styles.project__toolbar__controls}>
					<FontAwesomeIcon className={styles.project__toolbar__control} icon="trash" />
					<FontAwesomeIcon className={styles.project__toolbar__control} icon="pen-square" />
				</div>
			</div>
		</div>
	);
};

export default AdminProject;
